import './App.css';
import {useEffect} from 'react'
import ethers from 'ethers'

function App() {

  var temp = 0

  useEffect(() => 
  {
    setTimeout(() =>
    {
      temp = temp + 1;
    }, 1000)
  })

  return (
    <div className="App">
      <h1> {temp} </h1>
    </div>
  );
}

export default App;
